#root.root {--tabs-activated-bg: rgb(106,106,120);}
#root.root {--tabs-indent: 8px;}
#root.root {--tabs-normal-bg: rgba(106,106,120,0.0);}
#root.root {--tabs-normal-fg: #fbfbfe;}



#root.root {--tabs-border-radius: 10px;}
#root.root {--tabs-lvl-opacity: 0.26;}
#root.root {--general-margin: 0px;}
#root.root {--general-border-radius: 5px;}
#root.root {--frame-bg: transparent ;}
#root.root {--tabs-pinned-width: 50px;}

#root.root {--border: rgba(106,106,120,0);}
#root.root {--natsumi-primary-color: rgba(106,106,120,0);}
#root.root {--active-el-bg: rgba(106,106,120,0);}
#root.root {--natsumi-glass-shadow-opacity: 0%;}
#root.root {--natsumi-colors-primary: rgba(0,0,0,0);}
#root.root {--natsumi-colors-secondary: rgba(0,0,0,0);}
#root.root {--natsumi-colors-tertiary: rgba(0,0,0,0);}
#root.root {--natsumi-colors-primary-foreground: rgba(0,0,0,0);}
#root.root {--natsumi-glass-background: rgba(0,0,0,0);}
#root.root {--notification-bg: rgba(66,65,77,0);}


#root.root {--ctx-menu-separator: rgba(82,82,94,0);}
#root.root {--ctx-menu-bg: rgba(66,65,77,0);}
#root.root {--popup-bg: rgb(66,65,77,0);}

#root.root {--toolbar-bg: rgba(43,42,51,0);}
#root.root {
  --tabs-height: 33px;
  --tabs-pinned-height: 44px;
  --tabs-margin: 8px;
  --tabs-indent: 19px;
  --tabs-close-btn-margin: 5px;
  --tabs-inner-gap: 10px;
  --general-border-radius: 6px;
  --tabs-color-layer-opacity: 0.25;
  --tabs-activated-bg: rgba(0, 0, 0, 0.5);
}
#root .popup-container {
  background-color: transparent;
}
#root .hidden-panels-popup-layer:before {
  background-color: transparent;
}

/* PINNED TABS */

.Tab[data-pin="true"] .body {
  box-shadow: 0px 2px 1px #00000000;
  background: #f2f2f220;
  color: #ffffff60;
}

.Tab[data-pin="true"][data-active="true"] {
  background-color: #ffffff40;
  border-radius: calc(var(--general-border-radius) + 2px);
}

.Tab[data-discarded="true"] > .body > .fav {
  opacity: 1;
}

#root .TabsPanel .PinnedTabsBar {
  display: flex;
  flex-wrap: wrap;
  margin: 0;
  padding: 0;
  margin-top: 90px;
}

.PinnedTabsBar .tab-wrapper {
  flex-grow: 1;
  min-width: 55px;
  --tabs-pinned-width: auto;
}
.PinnedTabsBar {
  flex-grow: 1;
  min-width: 55px;
  --tabs-pinned-width: auto;
  margin-top: 90px;
}

/* GENERAL */

.AnimatedTabList .Tab {
  width: calc(100% - 16px);
  left:8px;
}
.AnimatedTabList .Tab .title,
.TabsPanel .AnimatedTabList .new-tab-btn:after {
  font-size: 0.9rem;
}

body {
  height: 100vh;
  overflow: hidden;
}

.AnimatedTabList .bottom-space {
  display: none;
}

/* SEPARATOR */

#root .top-shadow,
#root .bottom-shadow {
  border: #f2f2f220 1px solid;
  box-shadow: none;
  height: 1px;
  border-radius: var(--general-border-radius);
}

#root .top-shadow {
  top: 0;
}

#root .bottom-shadow {
  bottom: 0;
}

.Tab .close-icon {
  height: 24px;
  width: 24px;
  top: calc(50% - 12px);
  left: calc(50% - 12px);
}

/* Smoothen masking for overflowed tab title. */
.Tab .title {
  background: linear-gradient(90deg, var(--tabs-normal-fg) 80%, #f1f1f100 99%);
  background-clip: text;
  color: transparent;
}

.TabsPanel .Tab {
  margin: 0;
}

.TabsPanel {
  display: flex;
  gap: 12px;
}

/* NEW TAB BUTTON*/
.TabsPanel .new-tab-btns {
  position: relative;
}

.TabsPanel .new-tab-btn {
  margin: calc(var(--tabs-margin) * 0.5) 0;
  --ntb-btn-height: 37px;
}

.TabsPanel .new-tab-btn:first-of-type {
  justify-content: left;
  padding-left: calc(var(--tabs-inner-gap));
  margin: calc(var(--tabs-margin) * 0.5) 0;
  --ntb-btn-height: 37px;
}

.TabsPanel .new-tab-btn:first-of-type >svg,
.TabsPanel .new-tab-btn:first-of-type >img {
  fill: transparent;
  background-color: var(--nav-btn-fg);
  opacity: 40%;
  width: 17px;
  height: 17px;
  scale: 0.9;
  mask: url("data:image/svg+xml;base64,");
}

.TabsPanel .new-tab-btn:first-of-type > svg.-badge,
.TabsPanel .new-tab-btn:first-of-type > img.-badge {
	width: 0;
	height: 0;
}

.TabsPanel .new-tab-btn:first-of-type:after {
  justify-content: left;
  content: "New Tab";
  font: var(--tabs-font);
  padding-left: calc(var(--tabs-inner-gap) + var(--tabs-margin) + 12px);
  color: var(--nav-btn-fg);
  opacity: 40%;
}

/* NAVBAR */

#root.root {
  --nav-btn-width: 27.5px;
}
#root.root {
  --nav-btn-height: 27.5px;
}
#root.root {
  --nav-btn-margin: 0px;
}
#root.root {
  --toolbar-bg: transparent;
}

/* Moving Sidebery navigation bar to bottom, to mimic how Space works on Arc Browser. Make sure to choose Horizontal when activating the navigation bar. */

/* Remove background color, border and shadow for active tab panel. */
.NavigationBar .nav-item[data-active="true"] {
  background-color: transparent;
  box-shadow: none;
}

/* Making non-active tabs (including bookmark panels) grayscale. */
.NavigationBar .nav-item[data-type="tabs"][data-
active="false"] .icon {
  fill: var(--nav-btn-fg);
  opacity: 40%;
  scale: 0.75;
}
.NavigationBar {
  fill: var(--nav-btn-fg);
  opacity: 100%;
  scale: 0.927;
}
.NavigationBar .nav-item[data-type="bookmarks"][data-active="false"] .icon {
  fill: var(--nav-btn-fg);
  opacity: 40%;
  scale: 0.75;
}

/* Settings related to Hidden Panels icon and popup layer, adapting to the flipped navbar orientation. */
#hidden_panels_btn.nav-item .icon {
  transform: scaleY(-1);
  opacity: 40%;
  scale: 0.9;
}
.hidden-panels-popup-layer {
  transform: scaleY(-1);
  margin-top: -15%;
  --toolbar-bg: transparent;
}
.NavigationBar .hidden-panels-popup-content {
  transform: scaleY(-1);
}

/* Adjust 'add tabs panel' size & position. */
#root .PanelConfigPopup .popup {
  width: 80vw;
  margin-top: 25vh;
}

/* Replacing 'add tabs panel' button with Fluent plus icon to mimic Arc's 'new space' button. */
.NavigationBar #add_tp.nav-item .icon {
  fill: transparent;
  background-color: var(--nav-btn-fg);
  width: 80%;
  height: 80%;
  mask: url("data:image/svg+xml;base64,");
}

/* Replacing 'history' panel with Fluent archive icon to mimic Arc's 'recently closed' button. */
.NavigationBar #navhistory.nav-item .icon {
  fill: transparent;
  background-color: var(--nav-btn-fg);
  display: flex;
  padding: auto;
  width: 80%;
  height: 80%;
  mask: url("data:image/svg+xml;base64,");
}

/* Replacing Sidebery 'settings' with Fluent settings icon to blend with Arc (Windows) aesthetic. */
.NavigationBar #settings.nav-item .icon {
  fill: transparent;
  background-color: var(--nav-btn-fg);
  width: 75%;
  height: 75%;
  mask: url("data:image/svg+xml;base64,");
}
#root {
  --tabs-height: 36px !important;
  --tabs-title-padding: 0px !important;
  --tabs-font-size: 1rem !important;
/* Moving Sidebery navigation bar to bottom, to mimic how Space works on Arc Browser. Make sure to choose Horizontal when activating the navigation bar. */
.NavigationBar {
  box-shadow: none;
}
.top-horizontal-box {
  margin-left: 5px;
  margin-right: 5px;
  margin-bottom: -20px;
  display: flex;
  order: 1;
}
